Natuurlijk moeten kinderen leren dat we elkaar geen pijn doen, maar geven we hen √®n de samenleving geen groot cadeau door hen te laten oefenen met conflicten oplossen?
Dat kan door niet de rol van politie of rechter, maar die van mediator in te nemen.
